		.then(function (response) {
			// handle success
			console.log(response);
		})
		.catch(function (error) {
			// handle error
			console.log(error);
		})
		.then(function () {
			// always executed
		});
	}
	return (
		<div className="Home">
			<Box sx={{ flexGrow: 1 }}>
				<Grid container spacing={1}>
					{/* {buildCards()} */}
					<EmployeeList list={props.list}/>
					{getData()}
